-- สวัสดี @everyone 

-- เราต้องการพูดถึงเหตุการณ์ล่าสุดที่เกี่ยวข้องกับ Bee Swarm Simulator เมื่อไม่กี่วันที่ผ่านมา Bee Swarm Simulatorได้เริ่มแบนเวฟโดยกำหนดเป้าหมายไปที่ เนียงโรง ฮัต และผู้ให้บริการโกงรายอื่น นอกจากนี้ พวกเขายังได้แนะนำ Beeperion 4.0 ซึ่งเป็นเวอร์ชันใหม่ของการป้องกันการโกงอีกด้วย

-- น่าเสียดายที่หลังจากนั้นไม่นาน ผู้พัฒนาบายพาสของเราในเวียดนามก็ถูก Onett บุกโจมตีโดยไม่คาดคิด ซึ่งหมายความว่านักพัฒนาของเราไม่สามารถช่วยเหลือเราได้อีกต่อไป เนื่องจาก Beeperion 4.0 เปิดตัวแล้ว และนักพัฒนาของเราไม่สามารถดำเนินการต่อได้ เราเหลือทางเลือกไม่กี่ทาง และหนึ่งในนั้นคือการปิดตัวลง

-- ขออภัยอย่างยิ่งหากสิ่งนี้ทำให้เกิดความไม่สะดวกหรือความผิดหวัง เราได้สำรวจวิธีแก้ปัญหาที่เป็นไปได้ทั้งหมดแล้ว แต่สำหรับตอนนี้ การปิดตัวลงดูเหมือนเป็นทางเลือกเดียวที่เป็นไปได้

